        famille: "Apidae et sous-famille: Andrenidae\nLes Andrènes ou \"abeilles des sables\" ou \"abeilles fouisseuses\", sont des Apocrites à langue courte qui récoltent le pollen sur leurs pattes postérieures (3ème paire de pattes) à l'aide de poils très denses et d'une brosse de poils (ou flocus) située à la base de ces mêmes pattes.\nElles vivent de façon solitaire et la femelle fondatrice présente la particularité de construire et d'approvisionner son propre nid, sans aucune aide de la part d'autres individus de l'espèce, dans des parois meubles, dans des cavités de vieux murs en pisé par exemple.\nLes Andrenidés considérées comme primitives ont une langue courte et visitent des fleurs au nectar facilement accessible (Apiacées, Astéracées, Brassicacées).\nLa sous-famille compte environ 185 espèces en France.",
