        bio_partic: "Elle récolte le pollen le matin, plus tôt que les autres espèces, uniquement sur la Bryone dioïque et la Bryone blanche. \nLes nids, généralement d'une profondeur inférieure à 10 cm, sont creusés dans le sol compact de milieux très divers. Solitaires, les femelles nidifient cependant en bourgade pouvant contenir jusqu'à une centaine de nids.\nLes mâles viennent aussi faire le plein de nectar sur la Vipérine, les Ronces, l'Aubépine épineuse et les Pissenlits.",
