    value:1069,
	name:"La Carte géographique forme orangé",
	label:"Araschnia levana",
    autres_noms: "Le Jaspé",
    classification: {
        niveau_determin: "espèce",
        nb_especes: "1",
        ordre: "Lépidoptères\nLes Lépidoptères ou papillons se caractérisent par leurs ailes couvertes de minuscules écailles souvent très colorées.\nOn les divise généralement en deux grands groupes : les papillons dits \"de jour\" ou Rhopalocères aux antennes en massue et les papillons dits \"de nuit\" (même si certains volent le jour) ou Hétérocères. Les dessins sur les ailes sont souvent utilisés pour leur identification.\nIls possèdent pour la plupart une trompe qui leur sert à aspirer le nectar.\nOn compte environ 5 000 espèces en France.",
        famille: "Nymphalidae\nDamiers, Mélitées, Nacrés, Satyres et Vanesses font partie de cette grande famille de Rhopalocères.\nLe dessus des ailes est souvent orange avec des motifs noirs ou brun avec des ocelles bien visibles. Le dessous des ailes est souvent beaucoup plus terne.\nLes pattes antérieures sont presque toujours réduites donnant l'impression que le papillon n'a que 4 pattes au lieu de 6.\nLa famille compte 130 espèces en France.",
        genre: "Araschnia\nLes espèces sont de petite taille, de couleur noire et blanche, ou noire et brune, avec un dimorphisme saisonnier très marqué. Yeux et palpes velus, antennes ayant à peu près la moitié de la longueur de l'aile, leur extrémité en massue plate. Ailes antérieures en triangle rectangle, aile postérieure largement ovale. Chenilles avec des épines ramifiées. Chrysalides suspendues. Vol gracieux, balancé.\nUne seule espèce dans le genre en France.",
        especes: "Araschnia levana (Linnaeus, 1758)",
    },
    presentation_taxon: {
        description: "Fort dimorphisme saisonnier entre les individus printaniers et estivaux, ainsi papillon aux couleurs et aux motifs très différents sur le dessus des ailes selon la génération.\nLa première génération (printanière) a les ailes de couleur fauve-orangé avec des taches noires, quelques taches blanches au bout des ailes antérieures et une série de taches bleues au bord des ailes postérieures.\nLa seconde génération (estivale) a les ailes noires ornées d'une bande médiane blanche et de bandes rougeâtres.\nLe dessous des ailes, identique chez les deux générations, orné d'un réseau complexe évoquant le nom vernaculaire de carte de géographie, est rouge-violet avec des nervures blanches.\nEn conditions climatiques clémentes (année très chaude), s'ensuit une pseudo troisième génération, descendance de la seconde, semblable à cette dernière, mais qui peut parfois présenter une coloration intermédiaire entre la première et la seconde génération.",
        bio_partic: "2 ou 3 générations de papillons par an. \nLa Carte géographique passe l'hiver sous forme de chrysalide.\nPonte singulière en plusieurs chapelets d'une dizaine d'œufs suspendus au revers des feuilles d'orties.\nLa chenille, identique pour toutes les générations, noire avec des épines brunâtres, grégaire, se nourrit uniquement sur l'Ortie dioïque (Urtica dioica)\nComportement territorial du mâle avec vol en plané et brusques accélérations très caractéristique.",
        envergure: "28-30 à 40\nCe papillon de jour est la plus petite des Vanesses européennes.",
        periode_obs: "Avril-Mai (printanière), Juin-Juillet (estivale) et parfois Mi-Août à Septembre (pseudo 3e génération)",
        habitat: "Assez commune mais demeure localisée.\nBien adaptée aux milieux rudéraux, espèce mésophile des lisières, des bois clairs, des terrains accidentés et des friches industrielles où pousse l'Ortie dioïque sa plante-hôte. \nPrésence de plantes nectarifères vitale (Astéracées, Apiacées) car espèce très floricole.\nPréférence pour les terrains frais et humides (berges, fossés, bordures de prairies inondables).",
        status_protection: "non protégé",

    },
