        famille: "Halictidae\nLes Halictes ou \"abeilles de la sueur\" sont des Apocrites à langue courte qui construisent des terriers dans des sols meubles. Elles récoltent le pollen grâce à des brosses de poils présentes sur les pattes postérieures.\nLa famille compte environ 170 espèces en France.",
